een known to remodel the electricity supply system of the entire city during lunch breaks.\')',NULL,NULL),(302,151,'trace','[{\"file\":\"/var/www/html/wp-includes/class-wp-hook.php\",\"line\":286,\"function\":\"log_postmeta_query\",\"class\":\"Ninja_Forms\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/plugin.php\",\"line\":208,\"function\":\"apply_filters\",\"class\":\"WP_Hook\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":1871,\"function\":\"apply_filters\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":2181,\"function\":\"query\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":2103,\"function\":\"_insert_replace_helper\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/meta.php\",\"line\":109,\"function\":\"insert\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/meta.php\",\"line\":219,\"function\":\"add_metadata\"},{\"file\":\"/var/www/html/wp-includes/post.php\",\"line\":2061,\"function\":\"update_metadata\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/Database/Models/Submission.php\",\"line\":406,\"function\":\"update_post_meta\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/Database/Models/Submission.php\",\"line\":422,\"function\":\"_save_field_value\",\"class\":\"NF_Database_Models_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/Database/Models/Submission.php\",\"line\":286,\"function\":\"_save_field_values\",\"class\":\"NF_Database_Models_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/Actions/Save.php\",\"line\":237,\"function\":\"save\",\"class\":\"NF_Database_Models_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/AJAX/Controllers/Submission.php\",\"line\":438,\"function\":\"process\",\"class\":\"NF_Actions_Save\",\"type\