a-forms/includes/Database/Models/Submission.php\",\"line\":286,\"function\":\"_save_field_values\",\"class\":\"NF_Database_Models_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/Actions/Save.php\",\"line\":237,\"function\":\"save\",\"class\":\"NF_Database_Models_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/AJAX/Controllers/Submission.php\",\"line\":438,\"function\":\"process\",\"class\":\"NF_Actions_Save\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-content/plugins/ninja-forms/includes/AJAX/Controllers/Submission.php\",\"line\":128,\"function\":\"process\",\"class\":\"NF_AJAX_Controllers_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/class-wp-hook.php\",\"line\":286,\"function\":\"submit\",\"class\":\"NF_AJAX_Controllers_Submission\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/class-wp-hook.php\",\"line\":310,\"function\":\"apply_filters\",\"class\":\"WP_Hook\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/plugin.php\",\"line\":465,\"function\":\"do_action\",\"class\":\"WP_Hook\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-admin/admin-ajax.php\",\"line\":173,\"function\":\"do_action\"}]',NULL,NULL),(305,153,'query','INSERT INTO `wp_postmeta` (`post_id`, `meta_key`, `meta_value`) VALUES (65, \'_field_21\', \'COLLEGE TOUR EXPERIENCE One of my main goals in life is to be successful. Becoming successful is a lot of hard work. There are a total of twelve grades needed to be completed in this lifetime, just to be able to gain acknowledgement and education of what will occur in life. Well I’ve made it to my junior year in high school and it’s been a rough road but I’m still pushing through. One of my major goals is to make it to college to start my career and have a successful future.\\n\\n	The current high school that I’m attending is teachers preparatory. The deans, Ms. Wilson, Mr. Otto and Mr.Gansrow allowed me to participate in this year college tour. Our bus trip to the first college is Binghamton University. All I can think about is this can…show more content…\\nAnother college that seems to provide that attention is Oneonta. We arrived at Oneonta College and the first thing I see is SNOW!!! This tells me that the temperature up here is cooler then the temperature in Brooklyn. The appearance of the school seemed pretty quiet and small, which is an advantage towards Binghamton. When we entered a young man who has graduated from Oneonta and now works there explained to us about admissions, programs, and life on and around Oneonta College. Our tour guidance at Oneonta was a junior name Alexis who majored in education and biology so far in the school. The first area she showed us was the diner area which was smaller than the lunch space in Binghamton but it was cozy and comfortable. Next were the classrooms which some can fit up to 300 students and some were made for smaller classes such as 17 students to 1 instructor.\')',NULL,NULL),(306,153,'trace','[{\"file\":\"/var/www/html/wp-includes/class-wp-hook.php\",\"line\":286,\"function\":\"log_postmeta_query\",\"class\":\"Ninja_Forms\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/plugin.php\",\"line\":208,\"function\":\"apply_filters\",\"class\":\"WP_Hook\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":1871,\"function\":\"apply_filters\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":2181,\"function\":\"query\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/wp-db.php\",\"line\":2103,\"function\":\"_insert_replace_helper\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/meta.php\",\"line\":109,\"function\":\"insert\",\"class\":\"wpdb\",\"type\":\"->\"},{\"file\":\"/var/www/html/wp-includes/meta.php\",\"line\":219,\"function\":\"add_metadata\"},{\"file\":\"/var/www/html/wp-includes/post.php\",\"line\":2061,\"function\":\"update_metadata\"},{