s like Facebook, Twitter, Google+, LinkedIn or others. Users details will be automatically pulled from their social profiles.\";s:4:\"link\";s:169:\"https://wpeverest.com/wordpress-plugins/user-registration/social-connect/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-social-connect\";}i:2;O:8:\"stdClass\":4:{s:5:\"title\";s:9:\"MailChimp\";s:5:\"image\";s:114:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/mailchimp.png\";s:7:\"excerpt\";s:203:\"MailChimp add-on of User Registration plugin synchronizes your mailChimp account with User Registration plugin and automatically subscribes your site users to your mailchimp mailing list on registration.\";s:4:\"link\";s:159:\"https://wpeverest.com/wordpress-plugins/user-registration/mailchimp/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-mailchimp\";}i:3;O:8:\"stdClass\":4:{s:5:\"title\";s:23:\"WooCommerce Integration\";s:5:\"image\";s:118:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/woo-extension.png\";s:7:\"excerpt\";s:148:\"Integrates WooCommerce plugin with your user-registration and allows you to manage user billing, shipping, orders via user registration account page\";s:4:\"link\";s:163:\"https://wpeverest.com/wordpress-plugins/user-registration/woocommerce/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-woocommerce\";}i:4;O:8:\"stdClass\":4:{s:5:\"title\";s:19:\"Content Restriction\";s:5:\"image\";s:124:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/content-restriction.png\";s:7:\"excerpt\";s:152:\"Content Restriction addon allows you to restrict full or partial content from page, post to only logged in users or logged in users with specific roles.\";s:4:\"link\";s:179:\"https://wpeverest.com/wordpress-plugins/user-registration/content-restriction/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-content-restriction\";}i:5;O:8:\"stdClass\":4:{s:5:\"title\";s:15:\"Advanced Fields\";s:5:\"image\";s:120:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/advanced-fields.png\";s:7:\"excerpt\";s:213:\"Advanced Fields provides you with additional advanced fields like Section Title, Custom HTML, Phone, Time Picker and WYSIWYG Fields. These fields will allow you to create more complex registration forms with ease.\";s:4:\"link\";s:171:\"https://wpeverest.com/wordpress-plugins/user-registration/advanced-fields/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-advanced-fields\";}i:6;O:8:\"stdClass\":4:{s:5:\"title\";s:17:\"Conditional Logic\";s:5:\"image\";s:122:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/conditional-logic.jpg\";s:7:\"excerpt\";s:227:\"Conditional Logic allows you to create more dynamic forms based on user input. You can now show or hide specific fields based on the users other input in the form. A field hide or show based on on multiple conditions fulfilled.\";s:4:\"link\";s:175:\"https://wpeverest.com/wordpress-plugins/user-registration/conditional-logic/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-conditional-logic\";}i:7;O:8:\"stdClass\":4:{s:5:\"title\";s:15:\"Profile Connect\";s:5:\"image\";s:120:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/profile-connect.png\";s:7:\"excerpt\";s:211:\"Connect your old users i.e users created via some other plugins, default WordPress registration form to user registration forms. Allows both individual as well as bulk connection of users to any particular form.\";s:4:\"link\";s:171:\"https://wpeverest.com/wordpress-plugins/user-registration/profile-connect/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-profile-connect\";}i:8;O:8:\"stdClass\":4:{s:5:\"title\";s:19:\"PDF Form Submission\";s:5:\"image\";s:124:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/pdf-form-submission.png\";s:7:\"excerpt\";s:217:\"PDF Form Submission addon allows to export registration form data in pdf form. PDF are great way to record, print and share with your team members. Automatically attachs the pdf to emails send to your users and admin.\";s:4:\"link\";s:179:\"https://wpeverest.com/wordpress-plugins/user-registration/pdf-form-submission/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-pdf-form-submission\";}i:9;O:8:\"stdClass\":4:{s:5:\"title\";s:14:\"PayPal Payment\";s:5:\"image\";s:119:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/payment-paypal.png\";s:7:\"excerpt\";s:174:\"Integrates PayPal into your forms for registration fee payments, donations, and more. set either predefined, user defined or hidden amount on the form as per the requirement.\";s:4:\"link\";s:163:\"https://wpeverest.com/wordpress-plugins/user-registration/payments/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-paypal-payment\";}i:10;O:8:\"stdClass\":4:{s:5:\"title\";s:11:\"Geolocation\";s:5:\"image\";s:116:\"https://raw.githubusercontent.com/wpeverest/extensions-json/master/user-registration/sections/images/geolocation.jpg\";s:7:\"excerpt\";s:187:\"Allows you to collect geo location data from users who registered on your site. Information like Country, City, Zip Code, Latitude/Longitude and location map for the user will accessible.\";s:4:\"link\";s:163:\"https://wpeverest.com/wordpress-plugins/user-registration/geolocation/?utm_source=dashboard_extenstion&utm_medium=banner&utm_campaign=user-registration-geolocation\";}i:11;O:8:\"stdClass\":4:{s:5:\"title\";s:9:\"LearnDash\";s:5:\"image\";s:114:\"