7,26,'_field_13','two'),(58,26,'_field_14','four'),(59,26,'_field_15','a:2:{i:0;s:4:\"five\";i:1;s:4:\"four\";}'),(60,26,'_form_id','2'),(61,26,'_seq_num','3'),(62,26,'_wp_trash_meta_status','publish'),(63,26,'_wp_trash_meta_time','1573035797'),(64,26,'_wp_desired_post_slug','26'),(65,25,'_wp_trash_meta_status','publish'),(66,25,'_wp_trash_meta_time','1573035800'),(67,25,'_wp_desired_post_slug','25'),(68,27,'_field_8','123'),(69,27,'_field_10',''),(70,27,'_field_11','Plagiarism detection is the process of locating instances of plagiarism within a work or document. The widespread use of computers and the advent of the Internet have made it easier to plagiarize the work of others. Detection of plagiarism can be undertaken in a variety of ways. Human detection is the most traditional form of identifying plagiarism from written work. This can be a lengthy and time-consuming task for the reader and can also result in inconsistencies in how plagiarism is identified within an organization. Text-matching software (TMS), which is also referred to as \"plagiarism detection software\" or \"anti-plagiarism\" software, has become widely available, in the form of both commercially available products as well as open-source software. TMS does not actually detect plagiarism per se, but instead finds specific passages of text in one document that match text in another document'),(71,27,'_field_12',''),(72,27,'_field_13',''),(73,27,'_field_14',''),(74,27,'_field_15','a:0:{}'),(75,27,'_form_id','2'),(76,27,'_seq_num','4'),(77,28,'_field_8','124'),(78,28,'_field_10',''),(79,28,'_field_11','Plagiarism detection is defined the process of locating instances of plagiarism within a document. TMS does not actually detect plagiarism exactly, but it finds specific passages of text in one document that match text in another document. Traditional form of identifying plagiarism from written work is human detection'),(80,28,'_field_12',''),(81,28,'_field_13',''),(82,28,'_field_14',''),(83,28,'_fiel