rk efficiently both as an individual contributor as well as along with a team'),(180,60,'_field_21','COLLEGE TOUR EXPERIENCE One of my main goals in life is to be successful. Becoming successful is a lot of hard work. There are a total of twelve grades needed to be completed in this lifetime, just to be able to gain acknowledgement and education of what will occur in life. Well I’ve made it to my junior year in high school and it’s been a rough road but I’m still pushing through. One of my major goals is to make it to college to start my career and have a successful future.'),(181,60,'_form_id','3'),(182,60,'_seq_num','1'),(183,61,'_field_16','1007'),(184,61,'_field_17','4'),(185,61,'_field_18','five'),(186,61,'_field_19','a:3:{i:0;s:1:\"v\";i:1;s:3:\"1-4\";i:2;s:5:\"three\";}'),(187,61,'_field_20','I work efficiently both as an individual contributor. My name is Jay'),(188,61,'_field_21','Becoming successful is a lot of hard work. There are a total of twelve grades needed to be completed in this lifetime, just to be able to gain acknowledgement and education of what will occur in life.\nThe current high school that I’m attending is teachers preparatory.'),(189,61,'_form_id','3'),(190,61,'_seq_num','2'),(191,62,'_field_16','1010'),(192,62,'_field_17','2'),(193,62,'_field_18','thirteen'),(194,62,'_field_19','a:2:{i:0;s:3:\"1-4\";i:1;s:1:\"v\";}'),(195,62,'_field_20','Hey, I am Sriniwas'),(196,62,'_field_21',''),(197,62,'_form_id','3'),(198,62,'_seq_num','3'),(199,63,'_field_16','1019'),(200,63,'_field_17','4'),(201,63,'_field_18','seven'),(202,63,'_field_19','a:2:{i:0;s:1:\"v\";i:1;s:3:\"1-4\";}'),(203,63,'_field_20','I can sum up my entire personal and professional life in three words – I can win! My dad and my current boss,'),(204,63,'_field_21','Another college that seems to provide that attention is Oneonta. We arrived at Oneonta College and the first thing I see is SNOW!!! This tells me that the temperature up here is cooler then the temperature in Brooklyn. The appearance of the school seemed pretty quiet and small, which is an advantage towards Binghamton. When we entered a young man who has graduated from Oneonta and now works there explained to us about admissions, programs, and life on and around Oneonta College. Our tour guidance at Oneonta was a junior name Alexis who majored in education and biology so far in the school. The first area she showed us was the diner area which was smaller than the lunch space in Binghamton but it was cozy and comfortable. Next were the classrooms which some can fit up to 300 students and some were made for smaller classes such as 17 students to 1 instructor. '),(205,63,'_form_id','3'),(206,63,'_seq_num','4'),(207,64,'_field_16','1087'),(208,64,'_field_17','2'),(209,64,'_field_18','five'),(210,64,'_field_19','a:3:{i:0;s:1:\"v\";i:1;s:3:\"1-4\";i:2;s:5:\"three\";}'),(211,64,'_field_20','Hey, I am Sriniwas!'),(212,64,'_field_21',''),(213,64,'_form_id','3'),(214,64,'_seq_num','5'),(215,65,'_field_16','1045'),(216,65,'_field_17','4'),(217,65,'_field_18','thirteen'),(218,65,'_field_19','a:2:{i:0;s:1:\"v\";i:1;s:3:\"1-4\";}'),(219,65,'_field_20','I am a dynamic figure. In my mind, I am often climbing mountains and crushing huge icebergs under my pirate ship! I have been known to remodel the electricity supply system of the entire city during lunch breaks.'),(220,65,'_field_21','COLLEGE TOUR EXPERIENCE One of my main goals in life is to be successful. Becoming successful is a lot of hard work. There are a total of twelve grades needed to be completed in this lifetime, just to be able to gain acknowledgement and education of what will occur in life. Well I’ve made it to my junior year in high school and it’s been a rough road but I’m still pushing through. One of my major goals is to make it to college to start my career and have a successful future.\n\n	The current high school that I’m attending is teachers preparatory. The deans, Ms. Wilson, Mr. Otto and Mr.Gansrow allowed me to participate in this year college tour. Our bus trip to the first college is Binghamton University. All I can think about is this can…show more content…\nAnother college that seems to provide that attention is Oneonta. We arrived at Oneonta College and the first thing I see is SNOW!!! This tells me that the temperature up here is cooler then the temperature in Brooklyn. The appearance of the school seemed pretty quiet and small, which is an advantage towards Binghamton. When we entered a young man who has graduated from Oneonta and now works there explained to us about admissions, programs, and life on and around Oneonta College. Our tour guidance at Oneonta was a junior name Alexis who majored in education and biology so far in the school. The first area she showed us was the diner area which was smaller than the lunch space in Binghamton but it was cozy and comfortable. Next were the classrooms which some can fit up to 300 students and some were made for smaller classes such as 17 students to 1 instructor.'),(221,65,'_form_id','3'),(222,65,'_seq_num','6');
